import React from 'react';
import GenericForm from './GenericForm';
import GetPortalConfiguracionTipoInteresadoModel from '../Maestras/Models/PortalConfiguracionTipoInteresadoModel';

export default function FaseForm() {

    const itemSelectResolve = (serviceName, value) => {
        return { value: value.id, label: value.attributes.nombre }
    }

    return (<GenericForm
        formName='Portal Configuracion Tipo Interesado'
        service='portal-tipo-interesado'
        ddlServices={['tipo-sujeto-procesal']}
        ddlServicesFunction={itemSelectResolve}
        model={GetPortalConfiguracionTipoInteresadoModel}
        successRedirect='/PortalConfiguracionTipoInteresado'
    />
    );
};
